import React from 'react'
import { Card,CardBody } from 'reactstrap';


export const Footer = () => {
    return (
        <div ClassName="footer">
 
       
       <p><b>Shwetalaha5@gmail.com</b></p>
       <form action>
         <input type="email" placeholder="Enter Your Mail" /><input type="submit" defaultValue="Send" />
         <br /><br />
         2021 Copyright. All Rights Reserved.
       </form>
       
     </div> 
   
        
    )
}
export default Footer;
